import { FaTimes } from 'react-icons/fa'
import Task from './Task'

const Tasks = ({ task, onDelete }) => {
  return (
    <div className="task">
        <h3>{task.text} <FaTimes
         style={{color: 'red',
         cursor: 'pointer'}}/></h3>
        <p>{task.day}
        onClick = {onDelete}</p>
    </div>
  )
} 

export default Tasks
